import React from 'react';
import './App.css';
import Page404 from './components/404';
import BBCNews from './components/BBC News';
import Home from './components/Home';
import { BrowserRouter as Router, Link, Route, Routes } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Container, Nav } from 'react-bootstrap'
function App() {
  return(  
  <Router>
    <div className='news-app'>
      <Navbar expand='lg' variant='dark' bg='dark'>
      <Container>
        <header>
        <h1 className='app-heading'>News App</h1>
        </header>
        <Nav className='me-auto'>
          <Nav.Link href="/home">Home</Nav.Link>
          <Nav.Link href="/BBCNews">BBC News</Nav.Link>
          <Nav.Link href="/Page404">Page404</Nav.Link>
        </Nav>
      <Routes>
        <Route exact path='/' element={<Home />} />
        <Route exact path='/BBCNews' element={<BBCNews />} />
        <Route exact path='/Page404' element={<Page404 />} />
      </Routes>
      </Container>
      </Navbar>
    </div>
  </Router>
  );
}

export default App;
